import React from "react";

const Works = () => {
  return (
    <>
      <div className='our_works'>
        <h2 className='section_title'>Our Works</h2>
        <p className='info_text'>Some of the projects we have worked on</p>
        <div className='works_wrapper'>
          <button className='info_button'>View More></button>
        </div>
      </div>
    </>
  );
};

export default Works;
